import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

const Bengali = () => {
  return (
    <div>
      <Navbar />
      <body className="p-5">
        <h1 className="text-center">All New Bengali Songs.</h1>
      </body>
      <Footer />
    </div>
  );
};

export default Bengali;
